// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./GateKeeperTwo.sol";

contract GatekeeperTwoAttack {
    GatekeeperTwo public victimContract;
    

    //call from constructor to get code size 0 even from a contract
    constructor (address _victimContractAddress)
    {
        bytes8 gateKey = bytes8(uint64(bytes8(keccak256(abi.encodePacked(address(this))))) ^ uint64(0) - 1);
        victimContract = GatekeeperTwo(_victimContractAddress);
        victimContract.enter(gateKey);
    }
}

